'use strict';var app=new Vue({el:'#app',data:{raw:'',clippings:[],search:'',loading:!0},mounted:function mounted(){var a=this;this.$http.get('/My Clippings.txt').then(function(b){a.raw=b.data,a.clippings=a.process(),a.loading=!1},function(b){console.log('There was an error loading the text file.')})},methods:{process:function process(){var a=this.raw.split('==========').reverse(),b=[];return a.forEach(function(d,e){var f={},g=d.split('\n');if(0==e)f.title=g[0],f.text=g[3],g[1]=g[1].split(' | '),f.meta=g[1][g[1].length-1];else{if(''==g[1])return;f.title=g[1],f.text=g[4],g[2]=g[2].split(' | '),f.meta=g[2][g[2].length-1]}2<g.length&&b.push(f)}),b}},computed:{filteredClippings:function filteredClippings(){var a=this;return a.clippings.filter(function(b){return-1!==b.title.toLowerCase().indexOf(a.search)||-1!==b.text.toLowerCase().indexOf(a.search)})}}});
